import React from 'react'; 
import Afternav from "../Coponent/nav_after";


class profile extends React.Component{
    constructor(props){
        super(props);
        this.state={
            last_name:"Tu",
            first_name:"",
            email:"",
            address:"",
            mobile_Phone:""
        }    
    }  
    handleChange(e){
        this.setState({
            
        })
    }
    filehandler = e =>{
        console.log(e.target.files[0]);
    }
    
    render() {

        return (
            <div className="room">
                <Afternav />   
                <div className="allPro">    
                        
                    <h2>Your Profile</h2>          
                    <div className="containerPro">
                        <div className="colPro1">
                            <img src="https://m.foolcdn.com/media/affiliates/images/add_authorized_user_EkoeHmZ.width-793.jpg?width=793" alt="avaotr"></img>
                            <input type="file" onChange={this.filehandler}/>
                        </div>
                        <div className="clear"></div>
                        <div className="colPro2">
                            <ul>
                                <li>
                                    <p>First Name: </p> <input type="text" onChange={this.handleChange.bind(this)} defaultValue={this.state.first_name}/>
                                </li> 
                            
                                <li>
                                    <p>Last Name: </p><input type="text" onChange={this.handleChange.bind(this)} defaultValue={this.state.last_name}/>
                                </li>                       
                            
                                <li>
                                    <p>Email: </p><input type="text" onChange={this.handleChange.bind(this)} defaultValue={this.state.email}/>
                                </li>                           
                            
                                <li>
                                    <p>Address: </p><input type="text" onChange={this.handleChange.bind(this)} defaultValue={this.state.address}/>
                                </li>                            
                            
                                <li>
                                    <p>Mobile Phone: </p><input type="text" onChange={this.handleChange.bind(this)} defaultValue={this.state.mobile_Phone}/>
                                </li>         
                                <button className="save_button">save</button>              
                            </ul>                      
                                
                        </div>
                    </div>
                </div>
            </div>
            )
    }  
    
}export default profile;
